import React, {useState} from 'react';
import './registration.css'

export const Registration = () => {

  const [user, setUser] = useState({
    username: "", 
    email: "",
    password: ""
  })


  return (
    <div className='registration'>
      <input type="text" name="username" value={user.username} placeholder='enter your username'/>
      <input type="email" name="email" value={user.email} placeholder='enter your email'/>
      <input type="password" name="password" value={user.password}  placeholder='enter password' />
      <div className="btn">Register</div>
      <div>Already have an account?</div>
      <div className="btn">Log In</div>
    </div>
  )
}
